import { NavLink } from 'react-router-dom'

const AdminUserPage = () => {
    return (
        <div>
            <h2><NavLink to="users/add">Them user</NavLink></h2>
            <h2><NavLink to="users/signip">login</NavLink></h2>
        </div>
    )
}

export default AdminUserPage
